export enum AccountStatus {
    A = "Active",
    D = "Disabled (NSPAY2.0)",
    E = "Disabled (EDS)",
}

export enum RequestStatus {
    APPROVED = "Approved",
    REJECTED = "Rejected",
    PENDING_APPROVAL = "Pending Approval",
    APPROVED_PROCESSED = "Approved (Processed)",
}

export enum RequestType {
    CREATE = "Create",
    UPDATE = "Update",
    DELETE = "Delete",
    ENABLE = "Enable",
    DISABLE = "Disable",
}

export enum ReviewStatus {
    APPROVED = "Approved",
    PENDING_APPROVAL = "Pending Approval",
    PENDING_FIRST_VERIFICATION = "Pending 1st Verification",
    PENDING_SECOND_VERIFICATION = "Pending 2nd Verification",
}

export enum Salutation {
    dr = "Dr",
    mr = "Mr",
    ms = "Miss",
    mrs = "Mrs",
    mdm = "Mdm",
    sir = "Sir",
}
